B.Ie=new A.cE("PRIVACY POLICY\nEffective Date: Nov 6, 2023\t\t\t\t\t\nWhat\u2019s the MOOV, Inc., including all past, present, and future parents, subsidiaries, affiliates, related companies, officers, directors, employees, agents, representatives, partners, and licensors) (\u201cMOOV,\u201d \u201cCompany,\u201d \u201cwe,\u201d \u201cus,\u201d or \u201cour) offers cutting edge technology, communication, group management and information services via its website, software, platforms, and mobile application (collectively, \u201cServices\u201d) pursuant to this Privacy Policy and our Terms of Use.\nOur Services are used by \u201cAdministrators,\u201d \u201cUsers,\u201d and \u201cVisitors,\u201d defined as follows:\n\t\t\t\t\t\n\u201cAdministrators\u201d are groups or organizations that utilize the Services for its own benefit and the benefit of its members.\t\t\t\n\u201cUsers\u201d are persons authorized by an Administrator to use the Services.\n\u201cVisitors\u201d view publicly published portions of the Services and are neither Administrators nor Users.\n \t\t\t\t\t\t\t\nAdministrators, Users and Visitors are collectively referred to as \u201cyou\u201d or \u201cyour\u201d.\n \t\t\t\t\t\t\t\nUNLESS OTHERWISE AGREED TO IN WRITING, BY USING THE SERVICES IN ANY WAY, INCLUDING AS AN ADMINISTRATOR, USER OR VISITOR, YOU AGREE TO BE BOUND BY THIS PRIVACY POLICY AND OUR TERMS OF USE. IF YOU DO NOT AGREE TO BE BOUND BY THIS PRIVACY POLICY AND OUR TERMS OF USE, THEN YOU MAY NOT USE THE SERVICES AND SHOULD STOP USING THE SERVICES IMMEDIATELY.\n \t\t\t\t\t\t\t\nWe collect certain private or personally identifiable information \u201cPersonal Information\u201d in order to improve and deliver our Services. This Privacy Policy explains the Personal Information we collect, why we collect it, and how we may use and share that information.\t\t\t\t\t \t\t\t\t\t\n1. Personal Information We May Collect:\n We may collect Personal Information such as:\n\t\t\t\t\t\nName,\t\t\t\t\t\nAge and date of birth,\t\t\t\t\nContact information (phone number, street address, email address, etc.),\nIdentity of associated parent(s) and guardian(s),\t\t\t\t\nDemographic information (race, ethnicity, gender, etc.)\nPrimary language(s) spoken or used to access the Services,\nDisability status,\t\t\t\t\t\t\nSchool information (school name, grade, school ID, and enrollment in classes, activities, clubs, sports, and other extracurricular activities),\nClass information (attendance, exchange of assignments and coursework, test scores, grades, etc.),\t\t\t\t\t\t\nDietary requirements,\t\t\t\t\t\nMode of transportation,\t\nCommunication preferences, \t\t\t\t\t\t\nCommunications sent or received via the Services, including downloads, uploads and data shared with third party providers such as social media channels, etc.,\nPrivacy preferences,\t\t\t\nHardware (make, model, device ID, etc.), IP address, operating system and web browser used to access the Services,\t\t\t\t\t\t\nUsage data regarding all interactions with the Services, Log-in (username and password) and profile information, \t\t\t\t\t\t\nCurrent and past location data, \t\t\t\t\t\t\nBilling, payment and other account information,Location information (for example, for bus tracking, fire drills, security, or other situations), and\t\nAny other information provided to us by an Administrator or User\n \t\t\t\t\t\t\t\nNot all items listed above are collected, and sometimes additional relevant or comparable information not listed is collected. The above list is offered as a representation of the types of Personal Information that may be collected.\n \t\t\t\t\t\t\t\t\t\t\t \t\t\t\t\t\n2. How We Collect Personal Information\nWe collect Personal Information from Users or Visitors directly from such Users and Visitors when they: i) register, create or accept Administrator-created accounts, ii) use the Services, iii) communicate through the Services, and/or iv) download or upload any data or material via the Services.\n\nWe may also collect Personal Information from Users and Administrators directly from Administrators. Administrators are solely responsible for ensuring that it has the required authority and permission to share any Personal Information provided to us.\n\t\t\t\t\t\nWe may also collect Personal Information through the use of technology tracking methods, audits of our Services and from certain third parties when we review the effectiveness of our Services and the marketing, promotion, and use of our Services.\n\t\t\t\t\t\n3. How We Protect Personal Information\nWhile we aim to protect all Personal Information in our care or custody with at least the degree of care that would be exercised by a prudent person given the sensitivity of the Personal Information, it is important to understand that we act solely as a data processor of information that is provided to us by Users and Administrators. Accordingly, the disclosure of Personal Information to us is the sole responsibility of the User and/or Administrator.\nIf you are a California resident, see the California Privacy Notice for California consumers below.\t\t\t\t\nIf you are a European Union or United Kingdom resident, see the EU and UK Privacy notice below.\t\t\t\t\t\nIf you are a Canadian resident, see the Canadian Residents notice below. 4. How We Use and Disclose Personal Information\nWe use and disclose Personal Information solely for the purpose of providing and improving our Services. We do not sell or otherwise monetize Personal Information by selling or sharing it with third parties.\n\t\t\t\t\t\nSpecifically, we may use and disclose Personal Information as follows:\t\nTo provide the Services,\t\t\t\t\nTo enhance and improve the Services,\t\t\t\t\t\nTo facilitate the publication of communications initiated by Users and Administrators, either directly through the Services or through a third party channel (social media or other provider),\t\t\t\t\t\nSecurity analysis,\t\t\t\t\t\nLegal compliance, and\t\t\t\t\t\t\nGeneral corporate/business purposes.\n \t\t\t\t\t\t\t\nWe may use and disclose personal information with and to third parties when it is necessary to provide the Services or for our business (for example: to complete any of the foregoing activities; or when we need to process payments from Clients; or when we translate content that includes personal information from English into other languages; or when we comply with appropriate security standards).\n \t\t\t\t\t\t\t\nWhen we use and disclose personal information with third parties, the third parties are not allowed to access or use Personal Information of Users, unless it is needed to do their particular work with us. We will limit the Personal Information we provide to third parties as much as possible, and we will condition our sharing on strict confidentiality restrictions and security instructions when possible.\n \t\t\t\t\t\t\t\nFor a list of third parties with whom we share Personal Information, please contact us by email at \t\t\t\t\t\t\t\t.\n \t\t\t\t\t\t\t\nSome Personal Information may also be disclosed directly by an Administrator or other User (for example, if an Administrator posts content or images to a third party social media channel such as Facebook, Instagram, etc.). In any such case, the Administrator or User is solely responsible for the content it decides to publish. We do not screen, edit, filter, or moderate any content or communications exchanged via the Services.\n\t\t\t\t\nWe may also use and disclose anonymized or generalized (non-identifiable) aggregated information with third parties for various reasons, including to promote and improve our Services. In these circumstances, we will take appropriate measures to de- identify (and prevent any party from re-identifying) any information used or disclosed in this way.\n\t\t\t\t\t\n5. Advertising, Marketing, Ability to Opt-Out\t\t\nWe may use Personal Information to educate, advertise and market current and future features of our Services, as well as related products and services we may offer in the future. Any such communications will include information on how to opt-out of receiving such communications. Some features and communications, including those set by an Administrator, are required to use the Services, such as allowing communications from Administrators to Users.\n\t\t\t\t\t\nWe may also use cookies, beacons, and other similar tracking technologies. These are small text files that are sent by a website server to your browser when you visit a website and are stored in your browser. A few examples of how we use this technology include: we use cookies that are necessary for the Services to function, to recognize you when you return to the Services, to help us measure and improve engagement with Users, and to promote Services that we believe may be of interest to you. You may be able to manage the use of cookies for our Services by adjusting your individual browser settings. Please also note that if you do not allow certain cookies, then the Services may not function properly.\n\t\t\t\t\t\nYou can contact us by email at kevin@joinmoov.com for more information. \n\n6. California Privacy Notice\t\t\t\t\t\nThis California Privacy Notice describes how we as a business collect, use, disclose, and otherwise process Personal Information of individual residents of the State of California within the scope of the California Consumer Privacy Act of 2018 (\u201cCCPA,\u201d as amended by the California Privacy Rights Act of 2020, and its implementing regulations).\t\t\t\t\t\nThis California Privacy Notice applies only to individual Users of our Services who are residents of the State of California, and only where we act as a \u201cbusiness\u201d with or for that individual. For example, this section may apply for California residents who use our Services as a Visitor. For applicable Users, this section is a supplement to the other parts of this Policy.\nHowever, if you are a User using the Services under an Administrator-Created User Account, this section does not apply to you because we do not act as a business with or for individual Users. In these instances, the privacy and security policies of the Administrator govern your Personal Information and your rights. Even though this section does not apply to individual Users, below we have included the categories of personal information that might be collected at the direction of your Administrator. Not all categories will be collected or received for every User. We are providing this extra information as a courtesy and for information purposes only, and it does not change our obligations under the CCPA. Personal Information of Users is under the direct control of the Administrator, and we only collect User Personal Information that is reasonably necessary to provide the Services requested by the Administrator.\n\t\t\t\t\t\nAs explained above, we collect limited Personal Information about individual Users with whom we have a direct \u201cbusiness\u201d relationship. Not all categories will be collected or received for every individual. Under these circumstances, we may collect or receive (and may have collected or received during the 12-month period prior to the effective date of this Privacy Policy) the following categories of personal information:\n\t\t\t\t\t\nIdentifiers. We may collect name, address, phone number, email address, and other similar identifiers from you, from your device or browser, and from our third party business relationships, as may be instructed by the Administrator.\n \t\t\t\t\t\t\nOnline activity and device information. We may collect online activity and device information (for example: IP address, browser and device data, browsing history, search history, usage data, analytics information) from you, from your device or browser, and from our third party business relationships. For Users, online activity and device information may be collected at the direction of your Administrator.\n \t\t\t\t\t\t\nCommunications. We may collect communications (for example: content of communications with us, \u201ccontact us\u201d submissions, emails, logs, etc.) from you, from your device or browser, and from our third party business relationships. For Users, communications may also be collected at the direction of your Administrator.\n \t\t\t\t\t\t\nGeolocation. We may collect geolocation information (for example: location data from device or IP address) from you, from your device or browser, and from our third party business relationships. For Users, general geolocation may be collected at the direction of your Administrator.\n \t\t\t\t\t\t\nBiometric information. We do not collect biometric information (for example: hair color, height, voice, facial recognition). For Users, verification data from your device provider and/or browser may be collected at the direction of your Administrator in order to authenticate your login to the Services under the Administrator\u2019s account or for other reasons set by the Administrator.\n \t\t\t\t\t\t\nCharacteristics of protected classifications under CA law. For Users, protected classification information may be collected at the direction of your Administrator.\n \t\t\t\t\t\t\nEmployment or professional information. For Users, employment or professional information may be collected at the direction of your Administrator.\n \t\t\t\t\t\t\nAudio, visual, or similar sensory information. We may collect audio, visual, or similar sensory information (for example: photographs, voice and video recordings of calls with us (where permitted by law)) from you. For Users, audio, visual, or similar sensory information may be collected at the direction of your Administrator.\n \t\t\t\t\t\t\nCommercial information. We may collect commercial information (for example: information related to Services you have accessed or purchased, purchasing history and tendencies) from you, from your device or browser, and from our third party business relationships. For Users, commercial information may also be collected at the direction of your Administrator.\n \t\t\t\t\t\t\nOther personal information. We may collect other Personal Information from you, from your device or browser, and from our third party business relationships. For Users, other personal information may also be collected at the direction of your Administrator.\n \t\t\t\t\t\t\nInferences. We may collect inferences (for example: information that could be used to create a user profile reflecting your preferences, attitudes, behavior, and similar characteristics) from you, from your device or browser, and from our third party business relationships. For Users, other inferences may be collected at the direction of your Administrator.\n \t\t\t\t\t\t\nFinancial information. We do not collect financial information (for example: credit card and debit card numbers, account numbers) except for billing and payment information. For Users, financial information may be collected at the direction of your Administrator.\n \t\t\t\t\t\t\nSensitive personal information. Sensitive personal information (for example: social security numbers and other government-issued identifiers) is not collected.\n \t\t\t\t\t\t\t\nSee above for more information about the Personal Information we collect.\n \t\t\t\t\t\t\t\nWe may use your Personal Information for the purposes described above in Section 4 (\u201cHow We Use and Disclose Personal Information\u201d). This includes:\n \t\t\t\t\t\t\t\nTo provide, maintain, operate, and secure our Services;\t\nAs you direct or consent; \t\t\t\t\t\t\t\t\nFor legal purposes;\n \t\t\t\t\t\t\t\t\nTo contact you;\t\t\t\t\t\t\t\t\nFor account and other professional servicing;\t\t\t\nTo measure and improve client engagement; and\nFor corporate business purposes.\n \t\t\t\t\t\t\t\t\t\nPlease see section 4 above for additional information.\n \t\t\t\t\t\t\t\t\t\nAs also discussed in section 4 above, we may disclose Personal Information to the following categories of third parties for a business purpose:\n \t\t\t\t\t\t\t\t\nThird party vendors to provide, promote, or improve our Services. We may use and disclose Personal Information with third parties when it is necessary to provide the Services or for our business (for example: when an End User uses the Services to post social media, SMS, email, or voice communication that includes Personal Information; or when we need to process payments; or when we need help to ensure compliance with appropriate security standards).\n\nSocial media messaging vendors who enable the delivery of social media messages. We may use and disclose Personal Information with third parties to enable and transmit social media messages via the Services.\n \t\t\t\t\t\t\nEmail vendors who enable the delivery of email messages. We may use and disclose Personal Information with third parties to enable and transmit emails via the Services.\n \t\t\t\t\t\t\nMobile messaging vendors who enable the delivery of mobile messages. We may use and disclose Personal Information with third parties to enable and transmit SMS/MMS/Mobile messages via the Services.\n \t\t\t\t\t\t\nVoice/VOIP and other audible messaging vendors who enable the delivery of voice/VOIP and audible messages. We may use and disclose Personal Information with third parties to enable and transmit voice/VOIP and audible messages via the Services.\n \t\t\t\t\t\t\nThird parties at your direction. We may use and disclose Personal Information with third parties at your direction or with your consent (for example: third parties you choose to interact with via the Services).\n \t\t\t\t\t\t\nThird party analytics and performance vendors. We may use and disclose Personal Information with third parties to measure and improve client engagement (for example: Google Analytics to help us understand how our users use the Services).\n \t\t\t\t\t\t\nThird party security and technology vendors. We may use and disclose Personal Information with third parties for servicing and maintaining the Services (for example: to help us with security measures, billing, or technical support).\n \t\t\t\t\t\t\t\nPlease review other relevant sections of this Privacy Policy for more information about how we may disclose Personal Information.\n \t\t\t\t\t\t\t\nPlease note that we do not sell or otherwise attempt to monetize Personal Information with third parties. However, under the CCPA, some of our activities may be considered \u201csales\u201d of information or cross-context behavioral advertising . For example, we may disclose \u201cidentifiers\u201d (see above) with our third party business partners, or use tracking technologies as described above, to help us promote our Services to Users that are Visitors. We do not promote our Services through cross- context behavioral advertising to Users.\n \t\t\t\t\t\t\t\nAs stated above, we will not sell or share personal information about individual consumers under the age of legal majority for the purpose of commercial marketing or targeted advertising. For more information about our practices and policies for children\u2019s personal information, please see section 9 below.\n \t\t\t\t\t\t\t\nWe keep Personal Information we collect for as long as is needed and appropriate for your use of the Services as set out in our Terms of Use and this Privacy Policy.\n \t\t\t\t\t\t\t\nIf you are a qualifying California resident under CCPA, we provide the following rights with respect to your personal information when we act as a \u201cbusiness\u201d with or for you (subject to certain limitations in the CCPA):\n\t\t\t\t\t\nRight to know. Upon verifiable request we will provide you with the following information about your personal information over the prior 12 months: (1) the specific pieces and categories of personal information we have collected about you; (2) the categories of sources from which we have collected your personal information; (3) our business purposes for collecting, selling, and sharing your personal information; (4) the categories of third parties with which we have shared your personal information; (5) the categories of personal information we have disclosed about you for a business purpose; and (6) if applicable, categories of personal information we have sold or shared about you, and the categories of third parties to which the personal information was sold or shared, for cross- context behavioral advertising.\n \t\t\t\t\t\t\nRight to delete. Upon verifiable request we will delete personal information we have collected about you and will direct our service providers to do the same, subject to certain exceptions in the CCPA.\n \t\t\t\t\t\t\nRight to opt out of sales and sharing to third parties for cross-context behavioral advertising. We do not sell your personal information to third parties. Notwithstanding that, you have the right to direct us to not sell or share your personal information to third parties for cross-context behavioral advertising. In addition, we have provided our users with a link to submit this request, found here: . Please note that if you are not logged into an account when you submit an opt-out request, your request will only be associated with that browser. Please also note that if you opt-out from cross-context behavioral advertising, you may still receive ads from us, but they will not be tailored to you.\n \t\t\t\t\t\t\nRight to correct. Upon verifiable request we will correct any Personal Information that we have collected about you that is incorrect.\n \t\t\t\t\t\t\nLimit use and disclosure of sensitive Personal Information. You have the right to limit our use and disclosure of sensitive Personal Information for certain purposes in accordance with the CCPA.\n \t\t\t\t\t\t\nRight to not be subject to discrimination for enforcing your CCPA rights. You will not be discriminated against by us for your exercise of CCPA rights. We will not refuse the Services, change pricing, or provide a different quality of Services because of your exercise of CCPA rights. However, please note that in some instances, exercising certain CCPA rights may cause us to be unable to provide you with our Services because certain parts of the Services require Personal Information to function properly or effectively.\n \t\t\t\t\t\t\t\nPlease note, as explained above, this section does not apply to you if you use our Services as a User with an Administrator-Created User Account. In these instances, please contact your Administrator about your Personal Information and your rights.\n\t\t\t\nPlease note that we will need to verify your identity before processing CCPA and other California requests, which may require us to request and obtain additional information from you. To do so, we may ask that you provide us with your first name, middle name, last name, email address, phone number, and address. We may also ask you to provide answers to questions about yourself to help verify your identity. We may also use or rely on third-party identity services to help us with identification verification and defend against fraudulent requests. We will use that information only to review and address your requests. We reserve the right to decline or limit requests in certain circumstances \u2013 for example, when we are unable to verify your identity or locate information in our systems, or when you have previously made two CCPA requests in the prior 12 months, or as otherwise permitted by applicable law.\n\nYou may designate, in writing or through a power of attorney, an authorized agent to make requests on your behalf to exercise your CCPA and other California rights. Before accepting such a request from an agent, we will require the agent to provide us with proof that you have authorized it to act on your behalf, and we may also need you to verify your identity directly with us.\n\t\t\t\t\t\nPlease note that we will also comply with valid requests from California residents that have an established business relationship with us under California\u2019s \u201cShine the Light\u201d law.\n\t\t\t\t\t\nWe do not provide financial incentives related to the collection, use, or disclosure of Personal Information.\n\t\t\t\t\t\nIf you have questions, or would like to exercise any of your rights under the CCPA, please contact us at any of the following:\t\t\t\t\nBy email at kevin@joinmoov.com;\t\t\t\t\t\nBy telephone at +1 (631) 560-9452; or\nBy mail at 11 Woodrow Ln, Smithtown NY, 11787\n\n7. European Union and United Kingdom Privacy Notice\n\nIf you are an individual resident of the European Union or the United Kingdom, you have certain rights with respect to your personal information, including under the General Data Protection Regulation (\u201cGDPR\u201d) and the GDPR as transposed into the law of the United Kingdom (\u201cUK GDPR\u201d). This includes, among other rights, the right to be informed and request access to the personal information about you that we have collected via our Services. You may also have the right to ask that your personal information be corrected, updated, or deleted.\nPlease note that we will comply with valid requests from residents of the European Union and the United Kingdom subject to relevant legal exemptions. Please also note that we will need to verify your identity before processing any such requests, which may require us to request and obtain additional information from you. We will use that information only to review and address your requests. We reserve the right to decline or limit requests in certain circumstances \u2013 for example, when we are unable to verify your identity or locate information in our systems, or as otherwise permitted by applicable law.\n\nYou may designate, in writing or through a power of attorney, an authorized agent to make requests on your behalf to exercise your rights under this section. Before accepting such a request from an agent, we will require the agent to provide us with proof that you have authorized them to act on your behalf, and we may also need you to verify your identity directly with us.\n\nIf you use our Services under an account of an Administrator, please contact your Administrator about your personal information and your rights. Otherwise, if you have questions, or would like to exercise any of your rights under the GDPR, UK GDPR, or any similar right, as an individual user under an individual account, please contact us, care of our Data Protection Officer, at any of the following:\n\t\t\t\t\n\t\t\t\n\t\t\t\n\t\t\t\t\n\t\t\t\t\t\nBy email at kevin@joinmoov.com;\t\t\t\t\t\t\nBy telephone at +1 (631) 560-9452; or\n \t\t\t\t\t\t\nBy mail at 11 Woodrow Ln, Smithtown NY, 11787\nYou may also contact the data protection authority of your jurisdiction.\n\n\n \t\t\t\t\t\t\t\n8. Canadian Residents\n \t\t\t\t\t\t\t\nIf you are a Canadian resident, this section applies to you.\n\n\nConsent: By submitting personal information to us, or our service providers and agents, you consent to the collection use, disclosure, and transfer of your personal information in accordance with this Privacy Policy and as permitted or required by law. You may withdraw your consent at any time to the collection, use, disclosure, or transfer of your personal information time by contacting us at kevin@joinmoov.com. If you withdraw your consent (or if you decide not to provide certain personal information), you acknowledge that we may not be able to provide you, or continue to provide you, with certain products, services, or information that may be of value to you.\nRetention of Personal Information: The personal information we collect will be retained by us in accordance with applicable laws. However, we will take reasonable steps to destroy or permanently de-identify personal information we hold if it is no longer needed for the purposes for which it was collected.\n\t\t\t\t\t\nAccess and Correction: We will take reasonable steps to ensure the personal information we hold is accurate, complete and current. Upon your written request, and subject to certain exceptions provided by law, we will inform you of the existence, use, and disclosure of your personal information and give you access to that information. We may charge a minimal fee for providing such access to you. If you believe that the personal information that we hold about you is not accurate or complete, you may write to us at kevin@joinmoov.com. If you are able to establish that the information is not accurate or complete, we will take reasonable steps to delete and/or correct the information so that it is accurate, complete, and up-to-date. In order to facilitate a request to correct or update information, we may ask you to provide additional information to confirm your identity. Any such information will only be used for the purpose of confirming your identity and will not be retained by us.\n\t\t\t\t\t\nInterest-Based Advertising: To opt-out of interest-based advertising, and to find information about how to block or limit cookies, visit AdChoices, the Canadian self- regulatory program for online interest-based advertising, administered by the Digital Advertising Alliance of Canada (\u201cDAAC\u201d).\n\t\t\t\t\t\nCanada\u2019s Anti Spam Law (\u201cCASL\u201d) We will only send you commercial electronic messages (\u201cCEMs\u201d) where we have your express or implied consent to do so. Your consent to receive CEMs is implied where we have an existing business relationship with you, or you have reached out to us and made an inquiry within a certain time frame, or if you are a User. You may unsubscribe from receiving CEMs at any time, by clicking the unsubscribe button on an email or following the direction provided in a text message. This paragraph only applies to CEMs that are sent by us. CEMs sent by Administrators or other Users via the Services are the sole responsibility of the particular Administrator or User.\n\t\t\t\t\t\n9. Childrens and Student Data Privacy\nWe do not intentionally request, collect, store, or use Personal Information from or about any child under the age of legal majority for our own use. Instead, we only request, collect, store, and use Personal Information about children as is necessary to provide the Services to authorized Administrators and Users, and only as requested by the Administrators, as explained more fully in this Policy and in our Terms of Use.\n\t\t\t\t\t\nWhen we receive student data from an Administrator in connection with the Services, we collect, use, and maintain it under the direct control of the Administrator and only as is necessary to provide the Services requested by the Administrators and Users. We do not disclose student information to third parties except as reasonably necessary to provide the Services, as further explained above.\nIf you are a User using the Services pursuant to an Administrator-created account (for example: a student, parent, or guardian using a school-created User account), and you have questions or requests about the personal information of a student or want to review the personal information of a student that has been collected, please contact your Administrator directly.\n\t\t\t\t\t\nWe collect, use, and maintain student data in accordance with the Family Educational Rights and Privacy Act (\u201cFERPA\u201d) and the Children\u2019s Online Privacy and Protection Act (\u201cCOPPA\u201d), and only as is set out in this Policy and the Terms of Use.\n\t\t\t\t\t\nWhen a law or regulation creates other obligations about student data privacy, we work with the Administrator to allow the Administrator to comply. For example, through the Services, we collect, use, and maintain student data under the direct control of the Administrator as is required under FERPA.\n\t\t\t\t\t\nWithout limiting the generality of the foregoing, we rely on the Administrator to obtain the required legal consents from Users invited or added to the Services by the Administrator, including parents, guardians, and students. Administrators therefore consent, as agents for and on behalf of the children and other Users, parents, and guardians invited or added to the Services by the Administrator, to our collection, use, and storage of Personal Information about or from the children. We rely on Administrator consent per the previous sentence for the purposes of complying with COPPA, and we are authorized to presume that Administrators have obtained and will maintain all required parent or guardian consent for our collection, use, and disclosure of information for any children under the age of thirteen (13) that are invited or added to the Services under Administrator accounts. This is because, as explained above, we do not have direct relationships with individual Users of the Services, but rather the Administrators that create student User accounts.\n\t\t\t\t\t\nIn some circumstances, information provided by or about a child may be available or visible to other individual Users (for example, group communications or assignments, or information published by the Administrator or other Users).\n\t\t\t\t\t\nPLEASE NOTE while many parts of the Services do not require personal information to function as intended, we encourage parents and guardians to monitor their child\u2019s use of the Services, and to assist us by instructing them to never provide personal information on the Services without your permission.\n\t\t\t\t\t\nPLEASE NOTE that if you discover or are made aware of any activity or information on the Services that is or may be connected to the abduction or sexual exploitation of a child, you should contact law enforcement authorities immediately. Please see the National Center for Missing and Exploited Children (NCMEC) (www.missingkids.org/education) for more information and resources related to abduction and child sexual exploitation prevention.\n\t\t\t\t\t\n10.Security of Information, Data Transfers and Retention\nWe maintain controls and practices that we believe are reasonable to safeguard against the unauthorized access and use of Personal Information. For example, we conduct periodic system evaluations, maintain system and security certifications, review system access, and perform and maintain regular backups. We also use industry- accepted encryption practices to protect Personal Information during transfer and at rest. Our employees and contract personnel are bound by our Personal Information policies. Notwithstanding the foregoing, we cannot and do not guarantee the total security of Personal Information in all circumstances.\t\t\t\t\nIf we become aware of a security incident, we will comply with applicable law and notify impacted Users or Administrators as soon as practicable, and respond to them, in accordance applicable law.\t\t\t\t\t\nWe are based in the United States. Personal Information will be accessed, transferred, processed, and stored in the United States. However, some of our contractors and vendors may be located outside the United States or may transfer or process Personal Information outside the United States (for example, Microsoft, Google, and Amazon may provide us services through secure servers located outside the United States). By using the Services, you are consenting to the access, transfer, processing, and storage of Personal Information in the United States and outside the United States.\t\t\t\t\t\nWe retain and delete Personal Information as provided by applicable law, and to the extent not contrary to applicable law, as agreed by the parties in writing. We reserve the right to maintain a copy of any Personal Information we collected for the purpose of corporate record retention to be able to respond to government audits or process of law.\n\t\t\t\t\t\n11. Use of Third Party Services.\nThe Services include the ability to use and interact with third party services such as Facebook, Twitter, ticketing/promotional companies, etc.\t\t\t\t\t\nBy using any part of the Services that incorporates or is made available by a third party, you will also be subject to that third party\u2019s practices and policies which may differ materially from our practices and policies, especially with respect to privacy and security. Please note that we are not responsible for the practices and policies of any third party, including privacy and security practices and policies. If you choose to access or use any third party product or service, you do so at your own risk.\n\t\t\t\t\t\n12. Miscellaneous.\nWe may change this Privacy Policy at any time in our sole discretion. Any such changes will be effective immediately upon us posting the updated Policy. If we make updates or changes, we will give notice by updating the effective date for this Policy. In some cases, and in our sole discretion, we may provide additional notice (for example: by a pop-up or banner notice on the Services, or by sending you an email notification).\t\t\t\t\t\nNotwithstanding the foregoing, if we make updates or changes that materially change User rights with respect to personal information, or reduce the level of protection for Personal Information, we will comply with the requirements of applicable law.\n\t\t\t\t\t\nBy continuing to use the Services after changes are effective, you will be bound by the revised Privacy Policy. If you do not agree with any updates to the Privacy Policy, you may not continue to use the Services.\t\t\t\t\nThe most current version of the Privacy Policy can be viewed at: www.joinmoov.com/privacy.\n\t\t\t\t\t\n13. Contact Us.\t\t\t\t\nPlease feel free to contact us with respect to any questions you may have about this Privacy Policy at:\n\t\t\t\t\t\n+1 (631) 560-9452\n \t\t\t\t\t\t\nkevin@joinmoov.com\n \t\t\t\t\t\t\n11 Woodrow Ln, Smithtown NY, 11787\n \t\t\t\t\t\t\t\nEFFECTIVE AS OF: Nov 6, 2023\n",B.vI,null,null)
